class OAuthProviderTest extends PHPUnit_Framework_TestCase
{
    private $oauthToken;

    public function setUp()
    {
        $this->oauthToken = new OauthToken();
    }

    public function tearDown()
    {
        $this->oauthToken = null;
    }

    /**
     *method: verifyUser
     * when: called
     * with: userAndPassword
     * should: returnToken
     */
    public function test_verifyUser_called_userAndPassword_returnToken()
    {
        $accessorProviderMock = $this->getMock('AccessorProvider');
        $this->oauthToken->setUrl("https://cloudspaces.urv.cat:8080/v1/AUTH_6d3b65697d5c48d5aaffbb430c9dbe6a");
        $this->oauthToken->setId('-kb3MfMdqr+fvmdi5JMhamOI-zy97eS-a7qRdq6NhaqGaDsyk90Z3o4mReoS8ZrKWoKVBgI1c+CWdBlVDBpjnP+ISq2sZoy2p1YdRBWkrhWgECAKnoLmcIhs4o5XiQ5XZK-EuyCKJwGTwkCaXA=');
        $this->oauthToken->setExpire('2014-03-01 12:33:33');
        $settings = new Settings();
        $accessorProviderMock->expects($this->once())
            ->method('sendMessage')
            ->with($settings)
            ->will($this->returnValue('{"access": {"token": {"issued_at": "2014-02-28T12:33:33.275377", "expires": "2014-03-01T12:33:33Z", "id": "-kb3MfMdqr+fvmdi5JMhamOI-zy97eS-a7qRdq6NhaqGaDsyk90Z3o4mReoS8ZrKWoKVBgI1c+CWdBlVDBpjnP+ISq2sZoy2p1YdRBWkrhWgECAKnoLmcIhs4o5XiQ5XZK-EuyCKJwGTwkCaXA=", "tenant": {"description": "Description eyeos", "enabled": true, "id": "6d3b65697d5c48d5aaffbb430c9dbe6a", "name": "eyeos"}}, "serviceCatalog": [{"endpoints": [{"adminURL": "https://cloudspaces.urv.cat:8080/v1", "region": "RegionOne", "internalURL": "https://cloudspaces.urv.cat:8080/v1/AUTH_6d3b65697d5c48d5aaffbb430c9dbe6a", "id": "61807a44e9e141e998b67814bb1103c7", "publicURL": "https://cloudspaces.urv.cat:8080/v1/AUTH_6d3b65697d5c48d5aaffbb430c9dbe6a"}], "endpoints_links": [], "type": "object-store", "name": "swift"}, {"endpoints": [{"adminURL": "http://cloudspaces.urv.cat:35357/v2.0", "region": "RegionOne", "internalURL": "http://cloudspaces.urv.cat:5000/v2.0", "id": "1c77111ccbcc429a960d2bed06ea2942", "publicURL": "http://cloudspaces.urv.cat:5000/v2.0"}], "endpoints_links": [], "type": "identity", "name": "keystone"}], "user": {"username": "eyeos", "roles_links": [], "id": "d2e8f7afc0f742a39036b21d2ecde4fa", "roles": [{"name": "_member_"}, {"name": "rusers"}], "name": "eyeos"}, "metadata": {"is_admin": 0, "roles": ["9fe2ff9ee4384b1894a90878d3e92bab", "a0eeaa6045c54d0d8e3dcf35c8aaf1ab"]}}}'));

        $oauthProvider = new OAuth_Provider($accessorProviderMock);
        $actual = $oauthProvider->verifyUser($settings);
        $this->assertEquals($this->oauthToken,$actual);
    }

    /**
     *method: veryfyDateExpireToken
     * when: called
     * with: usernameAndPasswordAndDateExpireAndCurrentDate
     * should: returnDateNotExpire
     */
    public function test_verifyDateExpireToken_called_usernameAndPasswordAndDateExpireAndCurrentDate_returnDateNotExpire()
    {
        $dateExpire = "2014-02-24 11:50:00";
        $currentDate = "2014-02-23 11:00:00";

        $settings = new Settings();
        $oauthProvider = new OAuth_Provider();
        $actual = $oauthProvider->verifyDateExpireToken($dateExpire,$currentDate,$settings);
        $this->assertEquals(false,$actual);
    }

    /**
     *method: veryfyDateExpireToken
     * when: called
     * with: usernameAndPasswordAndDateExpireAndCurrentDate
     * should: returnToken
     */
    public function test_verifyDateExpireToken_called_usernameAndPasswordAndDateExpireAndCurrentDate_returnToken()
    {
        $dateExpire = "2014-02-24 11:50:00";
        $currentDate = "2014-02-24 11:50:01";
        $this->oauthToken->setUrl("https://cloudspaces.urv.cat:8080/v1/AUTH_6d3b65697d5c48d5aaffbb430c9dbe6a");
        $this->oauthToken->setId('-kb3MfMdqr+fvmdi5JMhamOI-zy97eS-a7qRdq6NhaqGaDsyk90Z3o4mReoS8ZrKWoKVBgI1c+CWdBlVDBpjnP+ISq2sZoy2p1YdRBWkrhWgECAKnoLmcIhs4o5XiQ5XZK-EuyCKJwGTwkCaXA=');
        $this->oauthToken->setExpire('2014-03-01 12:33:33');
        $settings = new Settings();
        $accessorProviderMock = $this->getMock('AccessorProvider');
        $accessorProviderMock->expects($this->once())
            ->method('sendMessage')
            ->with($settings)
            ->will($this->returnValue('{"access": {"token": {"issued_at": "2014-02-28T12:33:33.275377", "expires": "2014-03-01T12:33:33Z", "id": "-kb3MfMdqr+fvmdi5JMhamOI-zy97eS-a7qRdq6NhaqGaDsyk90Z3o4mReoS8ZrKWoKVBgI1c+CWdBlVDBpjnP+ISq2sZoy2p1YdRBWkrhWgECAKnoLmcIhs4o5XiQ5XZK-EuyCKJwGTwkCaXA=", "tenant": {"description": "Description eyeos", "enabled": true, "id": "6d3b65697d5c48d5aaffbb430c9dbe6a", "name": "eyeos"}}, "serviceCatalog": [{"endpoints": [{"adminURL": "https://cloudspaces.urv.cat:8080/v1", "region": "RegionOne", "internalURL": "https://cloudspaces.urv.cat:8080/v1/AUTH_6d3b65697d5c48d5aaffbb430c9dbe6a", "id": "61807a44e9e141e998b67814bb1103c7", "publicURL": "https://cloudspaces.urv.cat:8080/v1/AUTH_6d3b65697d5c48d5aaffbb430c9dbe6a"}], "endpoints_links": [], "type": "object-store", "name": "swift"}, {"endpoints": [{"adminURL": "http://cloudspaces.urv.cat:35357/v2.0", "region": "RegionOne", "internalURL": "http://cloudspaces.urv.cat:5000/v2.0", "id": "1c77111ccbcc429a960d2bed06ea2942", "publicURL": "http://cloudspaces.urv.cat:5000/v2.0"}], "endpoints_links": [], "type": "identity", "name": "keystone"}], "user": {"username": "eyeos", "roles_links": [], "id": "d2e8f7afc0f742a39036b21d2ecde4fa", "roles": [{"name": "_member_"}, {"name": "rusers"}], "name": "eyeos"}, "metadata": {"is_admin": 0, "roles": ["9fe2ff9ee4384b1894a90878d3e92bab", "a0eeaa6045c54d0d8e3dcf35c8aaf1ab"]}}}'));
        $oauthProvider = new OAuth_Provider($accessorProviderMock);
        $actual = $oauthProvider->verifyDateExpireToken($dateExpire,$currentDate,$settings);
        $this->assertEquals($this->oauthToken,$actual);
    }


}

